import React from "react";


class Chart extends React.Component {


render() {
    return (
    <MDBContainer>
      <h5 className="mt-3" style={{color:'#000'}}>Transportation Chart</h5>
      <Doughnut data={this.state.dataDoughnut} options={{ responsive: true }} />
    </MDBContainer>
    );
  }
}

export default Chart;
